values (10, 'RERC', 'RER conectado - RERC', 'Aumentar la participación de los Recursos Energéticos de fuentes Renovables (RER) en la matriz energética nacional en un 6.8% en el año 2030, reduciendo la proporción de la energía producida en base a la quema de combustibles fósiles, lo cual generará la reducción de emisiones de gases de efecto invernadero (GEI). Asimismo, la medida incluye la implementación de las centrales hidroeléctricas con una capacidad instalada menor a 20 MW.', 3, 'Aumentar la participación de los Recursos Energéticos Renovables (RER) y dar cumplimiento al Decreto Legislativo N° 1002, Ley de Promoción de la Inversión en Generación de Electricidad con el uso de Energías Renovables (2008).', 'Energía - Combustión estacionaria', '1', 7133, 6800, 333, 2, 1, 1, 2, 2, 'ico_nama_verde_01.svg', 'ico_nama_verde_01.svg', 'Metodologia RERC', 100);
