values (9, 'ER', 'Electrificación rural - ER', 'Llevar el servicio de electricidad a usuarios ubicados en áreas no conectadas a la red eléctrica utilizando como fuente de generación los recursos energéticos renovables (RER), mediante la instalación de sistemas fotovoltaicos (paneles solares), con lo cual se reducierón las emisiones de gases de efecto invernadero (GEI) al sustituir el uso de combustibles fósiles en los hogares para generar electricidad, por una energía eléctrica con fuentes renovables que no produce emisiones.', 2, 'Brindar el servicio de electricidad a usuarios ubicados en áreas no conectadas a la red utilizando como fuente de generación los recursos energéticos renovables (RER), mediante la instalación de sistemas fotovoltaicos (paneles solares).', 'Energía - Combustión estacionaria', '1', 12.6, 8, 4.6, 1, 1, 1, 2, 2, 'ico_nama_rojo_01.svg', 'ico_nama_rojo_01.svg', 'Metodologia ER', 2);
