values (11, 'GD', 'Generación distribuida - GD', 'Medida que abarca toda instalación de generación eléctrica que inyecte energía eléctrica a la red eléctrica está conectada directamente a la Red de Distribución.', 3, 'Promover el uso e implementación de sistemas de generación eléctrica con tecnologías limpias.', 'Energía - Combustión estacionaria', '1', 53, 42, 11, 3, 2, 1, 2, 2, 'ico_nama_verde_02.svg', 'ico_nama_verde_02.svg', 'Metodologia GD', 2);
