values (2, 'EESI', 'Eficiencia Energética en el sector industrial - EESI', 'Esta medida de mitigación, propuesta por el Ministerio de Energía y Minas, propone la implementación de medidas de eficiencia energética en empresas del sector industrial fomentando la competitividad de la economía nacional y reduciendo el impacto ambiental negativo del uso y consumo de los energéticos como la reducción de emisiones de GEI. Esta medida se enmarca en la Ley de Promoción del Uso Eficiente de la Energía, Ley N°27345, y su Reglamento aprobado por Decreto Supremo N°053-2007-EM. Así, se prevé considerar el recambio de motores y calderas, una vez que se viabilice el Fondo de Financiamiento a la Eficiencia Energética (FOFEE)', 1, 'Fomentar la competitividad de la economía nacional y reducir el impacto ambiental negativo del uso y consumo de los energéticos mediante la Ley de Promoción del Uso Eficiente de la Energía Ley N°27345 y su Reglamento, aprobado por Decreto Supremo N°053-2007-EM.', 'Energía - Combustión estacionaria', '1', 1605, 1200, 405, 6, 3, 3, 2, 2, 'ico_nama_amarillo_06.svg', 'ico_nama_amarillo_06.svg', 'Metodologia PVE', 2);
