values (3, 'EESC', 'Eficiencia energética en el sector comercial - EESC', 'Medida que propone promover la racionalización del consumo de energía en el sector comercial de servicios.', 1, 'Promover la racionalización del consumo de energía en el sector comercial de servicios, a través de: a) reemplazo de lámparas de baja eficiencia por lámparas LED de 10W y b) instalación de sensores de ocupación hotelera, con el objetivo de controlar las unidades de aire acondicionado.', 'Energía - Combustión estacionaria', '1', 313, 250, 63, 9, 5, 4, 2, 2, 'ico_nama_amarillo_07.svg', 'ico_nama_amarillo_07.svg', 'Metodologia EESI', 2);
