values (4, 'AESP', 'Auditorías energéticas en el sector público - AESP', 'Medida que propone implementar acciones que contribuyan a reducir el consumo de energía sin que estas acciones afecten la calidad de los servicios prestados y recibidos en las entidades del sector público cuya facturación mensual por consumo de energía eléctrica sea mayor de cuatro (4) unidades impositivas tributarias (UIT), reduciendo así las emisiones de GEI debido a la reducción del consumo energético. Asimismo, prevé que en un futuro las auditorías energéticas puedan desarrollarse para el sector privado, bajo el mecanismo de un fondo de eficiencia energética.', 1, 'Implementar acciones que contribuyan a reducir el consumo de energía sin que estas acciones afecten la calidad de los servicios prestados y recibidos en las entidades del sector público. Incluye todo equipo que consuma electricidad (con y sin fichas de homologación) con excepción de lámparas con fichas.', 'Energía - Combustión estacionaria', '1', 811, 600, 211, 6, 2, 4, 2, 2, 'ico_nama_amarillo_04.svg', 'ico_nama_amarillo_04.svg', 'Metodologia EESC', 100);
