values (5, 'ISR', 'Transformación del mercado de Iluminación en el Sector Residencial - ISR', 'Medida que promueve la sustitución de lámparas de baja eficiencia por tecnologías más eficientes de iluminación, reduciendo las emisiones de GEI debido al menor uso de energía, y generando la transformación hacia un mercado de iluminación más eficiente, cuyo principal objetivo es promover el uso de lámparas que permitan un uso eficiente de la energía en el país, sin menoscabar la calidad de la iluminación, considerando los beneficios económicos, ambientales y sociales que se tendrían en el país. La medida de mitigación propone dos fases: i) el programa de distribución de un millón y medio de lámparas energéticamente más eficientes a hogares de menores ingresos como meta al 2019, en el marco del Programa Anual de Promociones 2018, aprobado mediante Resolución Ministerial N° 021-2018-MINEM/DM, de acuerdo a lo establecido en el Plan de Acceso Universal a la Energía 2013-2022, aprobado con Resolución Ministerial N° 203-2013-MINEM-DM; y ii) la Estrategia de Iluminación del Perú, cuyo objetivo es incrementar la participación de las lámparas eficientes en el mercado de iluminación nacional, reduciendo el consumo de energía y por ende también reduciendo las emisiones de gases de efecto invernadero (como el CO2).', 1, 'Promover el uso de lámparas que permitan un uso eficiente de la energía en el país, sin menoscabar la calidad de la iluminación, considerando los beneficios económicos, ambientales y sociales que se tendrían en el país. Aplica para lámparas LED.', 'Energía - Combustión estacionaria', '1', 486, 400, 86, 1, 1, 0, 2, 2, 'ico_nama_amarillo_01.svg', 'ico_nama_amarillo_01.svg', 'Metodologia AESP', 100);
insert into T_MAE_MEDMIT (id_medmit, numero_medmit, nombre_medmit, descripcion_medmit, id_nama, objetivo_medmit, ipsc_medmit, flag_estado, gei_total, gei_publico, gei_privado, cant_total, cant_publico, cant_privado, asociado, id_ipcc, adjunto, adjunto_base, metodologia_medmit, usuario_asociado_medmit)
values (6, 'LSP', 'Reemplazo de lámparas en sector público - LSP', 'Reemplazo de lámparas de baja eficiencia por lámparas LED en el sector público reduciendo así el consumo de energía y por ende reduciendo también las emisiones de GEI, con el objetivo de impulsar el uso de lámparas y otros equipos de iluminación LED en todas las instituciones públicas. La medida se implementa a través de las fichas de homologación de tecnología LED, aprobadas por el MINEM, y que son instrumentos que permiten el reemplazo de luminarias menos eficientes por lámparas y otros equipos de iluminación LED en los procesos de compras públicas, lo que permite además la inclusión de estas tecnologías en la implementación de nuevos establecimientos estatales.'',''1'',''Impulsar el uso de lámparas eficientes en el sector público a través de las Fichas de Homologación de lámparas de tecnología LED. Aplica para lámparas LED. ', 1, 'Impulsar el uso de lámparas eficientes en el sector público a través de las Fichas de Homologación de lámparas de tecnología LED. Aplica para lámparas LED.Impulsar el uso de lámparas eficientes en el sector público a través de las Fichas de Homologación de lámparas de tecnología LED. Aplica para lámparas LED. ', 'Energía - Combustión estacionaria', '1', 278.4, 160, 118.4, 10, 7, 3, 2, 2, 'ico_nama_amarillo_05.svg', 'ico_nama_amarillo_05.svg', 'Metodologia ISR', 1);
