values (7, 'LAP', 'Lámparas de alumbrado público - LAP', 'Medida que promueve la implementación de lámparas de alta eficiencia en el alumbrado público reduciendo las emisiones de GEI debido al menor uso de energía, en el marco del Plan de Acceso Universal a la Energía (RM N°203-2013-MINEM/DM) y en donde se incluye el reemplazo de 100,000 lámparas de vapor de sodio de alta presión (VSAP) en alumbrado público por lámparas LED o de inducción, priorizando zonas vulnerables. Además, contempla una segunda fase a través de la implementación de las fichas de homologación de alumbrado público.', 1, 'Reemplazo de lámparas de alumbrado público de vapor de sodio de alta presión por lámparas LED consiste en la implementación de lámparas de alta eficiencia en el alumbrado público. Aplica para lámparas LED con fichas de homologación, 100,000 de FISE. ', 'Energía - Combustión estacionaria', '1', 1035, 720, 80, 1, 1, 0, 2, 2, 'ico_nama_amarillo_02.svg', 'ico_nama_amarillo_02.svg', 'Metodologia LAP', 2);
