prompt Loading T_MAE_TERMINOS...
insert into T_MAE_TERMINOS (id_terminos, id_rol, condiciones_terminos)
values (1, 1, 
        'El Proyecto Acciones Nacionales Apropiadas de Mitigación de energía (NAMA por sus siglas en inglés) en los sectores de generación de energía y su uso final en el Perú promueve acciones de sostenibilidad para alcanzar reducciones en emisiones de gases de efecto invernadero (GEI) como parte de los compromisos internacionales asumido por Perú dentro del marco de la Convención de las Naciones Unidas sobre Cambio Climático (CMNUCC o UNFCCC por sus siglas en inglés).' || chr(10) || 'En ese sentido, identificar y desarrollar acciones en el sector energía (por ejemplo, NAMAs) favorecerán a la reducción de emisiones de GEI y a su vez generarán beneficios sociales, ambientales y económicos.  De otro lado nuestro país, para el cumplimiento de sus compromisos, ha priorizado seis sectores para el diseño de acciones de reducción de emisiones de GEI / captura de CO2, los cuales son: Energía, Transporte, Agricultura, Desechos, USCUSS (Uso de Suelo, Cambio de Uso de Suelo y Silvicultura) y Procesos Industriales. En ese sentido, el sector energético (incluyendo transporte) es la segunda fuente de emisiones, después de USCUSS, con el 26% de las emisiones totales de GEI del país y llegando a aumentar 15% entre los años 1994 y 2000 (SCNCC ) y 50% entre los años 2000 y 2010 (FBUR ).  Por lo que, tenemos la gran responsabilidad de desarrollar NAMAs ambiciosas y efectivas para poder alcanzar el objetivo de las NDCs.' || chr(10) || 'En ese contexto, el Ministerio de Energía y Minas suscribió con el Programa de Naciones Unidas para el Desarrollo PNUD, el Convenio para implementar el Proyecto Acciones Nacionales Apropiadas de Mitigación (NAMA) en los sectores de generación de energía y su uso final en el Perú, cuyo financiamiento proviene del Fondo Mundial para el Medio Ambiente (GEF por su siglas en inglés), más el apoyo y cofinanciamiento de PNUD, MINAM, MEF y MEM.' || chr(10) || 'Recayendo su implementación en la Dirección General de Eficiencia Energética quien deberá liderar, diseñar, desarrollar, gestionar y coordinar cuatro (04) NAMAs de energía con sus respectivos sistemas de Monitoreo, Reporte, y Verificación (MRV), como producto de este proyecto. En ese sentido desde abril del 2016, el Proyecto inició el proceso de diseño conceptual de los mismos enfocándose en maximizar los beneficios sociales, ambientales y económicos para el país.  Por tal motivo, se ha elegido desarrollar las siguientes NAMAs a desarrollarse desde 2016 hasta 2020:' || chr(10) || '1.' || chr(9) || 'NAMA #1 (Eficiencia Energética): Mejoras en Eficiencia Energética en los sectores públicos y privadas;' || chr(10) || '2.' || chr(9) || 'NAMA #2 (RER Conectado): La promoción de las RER en sistemas interconectados;' || chr(10) || '3.' || chr(9) || 'NAMA #3 (RER Acceso Universal): Promoción del Acceso Universal a la Energía Sostenible; y' || chr(10) || '4.' || chr(9) || 'NAMA #4 (Transporte Eléctrico): Promoción de eficiencia energética en el sector transporte con la promoción de transporte eléctrico.' || chr(10) || '');
commit;
