CREATE OR REPLACE FORCE VIEW MRVMM.VW_T_GENM_ESCENARIO AS
SELECT E.ID_ESCENARIO,
           E.ID_MEDMIT,
           M.NOMBRE_MEDMIT,
           E.ANNO,
           E.BAU_EMISION,
           E.MIT_EMISION,
           E.REDUCCION,
           E.VALOR_SOFTWARE,
           E.EXPOST,
           E.META_ANUAL,
           E.FLAG_ESTADO
    FROM T_GENM_ESCENARIO E
    INNER JOIN T_MAE_MEDMIT M
    ON E.ID_MEDMIT = M.ID_MEDMIT;

