prompt Creating trigger MRVMM.TRG_LG_AUDITORIA
prompt =================================
prompt
CREATE OR REPLACE TRIGGER MRVMM."TRG_LG_AUDITORIA"
    before insert or update or delete on MRVMM.T_MAEM_FACTOR_DATA
    for each row
declare
    V_ID NUMBER;
begin
    IF UPDATING THEN
        SELECT SQ_MAEM_LG_FACTOR_DATA.NEXTVAL INTO V_ID FROM DUAL;
        INSERT INTO T_MAEM_MRV_LG_FACTOR_DATA
            (ID_LG_FACTOR,
             ACCION,
             ID_FACTOR,
             ID_DETALE,
             ID_PARAMETRO,
             VALOR,
             FACTOR,
             FLG_ESTADO,
             DETALLE,
             USUARIO,
             IP)
        VALUES
            (V_ID,
             'U',
             :OLD.ID_FACTOR,
             :OLD.ID_DETALLE,
             :OLD.ID_PARAMETRO,
             :OLD.VALOR,
             :OLD.FACTOR,
             :OLD.FLAG_ESTADO,
             'ANTES DE ACTUALIZAR',
             NVL(:OLD.USU_MODIFICA,USER),
             :OLD.IP_MODIFICA);

        SELECT SQ_MAEM_LG_FACTOR_DATA.NEXTVAL INTO V_ID FROM DUAL;
        INSERT INTO T_MAEM_MRV_LG_FACTOR_DATA
            (ID_LG_FACTOR,
             ACCION,
             ID_FACTOR,
             ID_DETALE,
             ID_PARAMETRO,
             VALOR,
             FACTOR,
             FLG_ESTADO,
             DETALLE,
             USUARIO,
             IP)
        VALUES
            (V_ID,
             'U',
             :NEW.ID_FACTOR,
             :NEW.ID_DETALLE,
             :NEW.ID_PARAMETRO,
             :NEW.VALOR,
             :NEW.FACTOR,
             :NEW.FLAG_ESTADO,
             'DESPUES DE ACTUALIZAR',
             NVL(:NEW.USU_MODIFICA,USER),
             :NEW.IP_MODIFICA);
    END IF;
    IF INSERTING THEN
        SELECT SQ_MAEM_LG_FACTOR_DATA.NEXTVAL INTO V_ID FROM DUAL;
        INSERT INTO T_MAEM_MRV_LG_FACTOR_DATA
            (ID_LG_FACTOR,
             ACCION,
             ID_FACTOR,
             ID_DETALE,
             ID_PARAMETRO,
             VALOR,
             FACTOR,
             FLG_ESTADO,
             DETALLE,
             USUARIO,
             IP)
        VALUES
            (V_ID,
             'I',
             :NEW.ID_FACTOR,
             :NEW.ID_DETALLE,
             :NEW.ID_PARAMETRO,
             :NEW.VALOR,
             :NEW.FACTOR,
             :NEW.FLAG_ESTADO,
             'REGISTRO DE DATOS',
             :NEW.USU_MODIFICA,
             :NEW.IP_MODIFICA);
    END IF;
    IF DELETING THEN
        SELECT SQ_MAEM_LG_FACTOR_DATA.NEXTVAL INTO V_ID FROM DUAL;
        INSERT INTO T_MAEM_MRV_LG_FACTOR_DATA
            (ID_LG_FACTOR,
             ACCION,
             ID_FACTOR,
             ID_DETALE,
             ID_PARAMETRO,
             VALOR,
             FACTOR,
             FLG_ESTADO,
             DETALLE,
             USUARIO,
             IP)
        VALUES
            (V_ID,
             'U',
             :OLD.ID_FACTOR,
             :OLD.ID_DETALLE,
             :OLD.ID_PARAMETRO,
             :OLD.VALOR,
             :OLD.FACTOR,
             :OLD.FLAG_ESTADO,
             'ANTES DE ELIMINAR',
             NVL(:OLD.USU_MODIFICA,USER),
             :OLD.IP_MODIFICA);
    END IF;
end TRG_LG_AUDITORIA;
/



